CREATE DATABASE IF NOT EXISTS eadp_${domainName}_db;
DROP TABLE IF EXISTS eadp_${domainName}_db.raw_${tableNameRaw}_t;
CREATE TABLE eadp_${domainName}_db.raw_${tableNameRaw}_t 
   (${columns})
ROW FORMAT SERDE 'org.apache.hadoop.hive.serde2.OpenCSVSerde'
WITH SERDEPROPERTIES (
   "skip.header.line.count"="1"
)
LOCATION 's3a://${bucketName}/${objectPath}';
